export default function MoodEntry({ selectedMood, setSelectedMood }) {
  console.log("MoodEntry props:", { selectedMood, setSelectedMood });

  if (!setSelectedMood) {
    return <div>Error: setSelectedMood prop is missing!</div>;
  }

  return (
    <div>
      <p>Selected Mood: {selectedMood || "No mood selected"}</p>
      <button onClick={() => setSelectedMood("HAPPY")}>Set Happy Mood</button>
    </div>
  );
}
